    "Density and productivity of ducks on western rangelands : An assessment in northcentral
    Montana and evaluation of methodology",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-08-30T12:25:07.818824",nt"name": "density-and-productivity-of-ducks-on-western-rangelands-an-assessment-in-northcentral-mont",nt"isopen":
    false,nt"url": null,nt"notes": "Declining continental populations of several
    duck species and deteriorating habitat conditions in the prairie pothole region
    emphasize the need to better understand duck production in areas where habitat deterioration
    may be less severe. Relatively high duck densities in conjunction with reduced availability
    of potential nesting habitat mean that reasonable sample sizes of nests often can
    be found in the prairie pothole region. Much lower duck densities (per unit of potential
    nesting habitat) on western grazing lands makes finding an adequate sample of nests
    exceedingly difficult. Objectives of this study were to: (1) test repeated pair
    counts arid brood counts as a method for evaluating duck productivity on western
    rangelands; (2) evaluate production rates on a sizeable portion of northcentral
    Montana using this method; and (3) provide an evaluation of the method and recommendation
    for expansion to the major potential duck production habitats on western grazing
    lands.  This report, including information on species composition, bird densities,
    and productions rates, is intended for the Central Flyway Committee.",nt"license_title":
